import React, { Component } from 'react';

class TodoItem extends Component {
	render() {
		return (
			<div onClick={this.handleClick}>
				{this.props.content}
			</div>)
	}

	handleClick() {
		alert(this.props.index);
	}
}

export default TodoItem;
